import React, { Component } from 'react'
import Nav from '../../components/navbar';

export default class SearchComponent extends Component {
  render() {
    return (
      <>
      <Nav/>
        <div className="bg-green-700">
            <input type="text" name="" id=""/>
            <button> Search For Goods </button>
        </div>
      </>
    )
  }
}
